import React from "react"
import "./Header.css"

function Header() {
    return (
        <nav className="bp3-navbar bp3-dark">
          <div className="bp3-navbar-group bp3-align-left">
            <div className="bp3-navbar-heading">Fetch commits</div>
            <input className="bp3-input" placeholder="owner" type="text" />
            <input className="bp3-input" placeholder="repo" type="text" />
            <input className="bp3-input" placeholder="author email" type="text" />
            <button id='fetch_button' onclick="PostReq()" className="bp3-button bp3-minimal bp3-icon-cloud-download">Download</button>
            button.onclick = PostReq();
          </div>
        </nav>
    )
}
const button = document.querySelector('fetch_button');

function PostReq() {
  return (
    fetch('/api/v1/fetch_and_save_commits/', {
      method: 'POST',
      headers: {
        'Accept': 'application/json',
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        owner: 'Dnar',
        repo: 'grabber',
        author_email: 'chanky@list.ru'
      })
    })
    )
}

export default Header
